import Product from "../components/Product"
import "./Catalog.css"

function Catalog(){

    const products = {
        title: "",
        price: 10,
        image: "",
        category: "",
        _id:""
    }
    return(
        <div className="catalog">
            <h2>CHECK OUR AMAZING CATALOG!</h2>

            <div className="products">
                <Product title = "Test 1"/>  
                <Product title = "Test 2"/>  
                <Product title = "Test 3"/>  
                <Product title = "Test 4"/>  
                <Product title = "Test 5"/>  
                <Product title = "Test 6"/>  
                <Product title = "Test 7"/>  
            </div>
        </div>
    );
}

export default Catalog;
